If someone you know is thinking about suicide, #BeThe1To help them connect to resources. Help them build a support system, including the 988 Suicide &amp; Crisis Lifeline, family, friends, clergy, coaches, co-workers, or therapists. #SPM22 #HELPTEXANSCONNECT
